import React from "react";
import ReactDOM from "react-dom";
import App from "./Pages/router/index";
import "typeface-lato";

ReactDOM.render(
  <React.StrictMode>

    <App />
  </React.StrictMode>,
  document.getElementById("root")
);
const THEME = createMuiTheme({
  typography: {
    fontFamily: ["Lato", "sans-serif"].join(","),
  },
});
